import React from 'react';
import '../styles/main';

export default class MainLayout extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      click: true,
    };
  }

  render() {
    return (
      <div className="mainlayout">
        hey {this.state.click && 'clicked'}
      </div>
    );
  }
}
